import React, { Component } from "react";
import styled from "styled-components";

const Tagline = styled.h1`
  line-height: 1.1;
  margin-bottom: 0px;
  font-weight: bold;
`;

const SubTagline = styled.h2`
  margin-top: 12px;
  line-height: 1.1;
  font-weight: 200;
`;

const HeroContainer = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  div {
    max-width: 60%;
    margin: 80px;
  }
  img {
    max-width: 40%;
    margin: 80px;
  }
`;

export default class HomePage extends Component {
  render() {
    return (
      <div>
        <HeroContainer>
          <div>
            <Tagline>
              Kill confusing email chains.<br></br> Leave feedback on the real
              thing.
            </Tagline>
            <SubTagline>
              An end-user testing and client feedback tool that lets people say
              what they really mean.
            </SubTagline>
          </div>

          <img src={"/static/images/hero.svg"} />
        </HeroContainer>
        <div className="p-4 shadow-xl rounded bg-blue-100 rounded-lg">
          <h1 className="text-gray-500 leading-tight">Next.js</h1>
          <p className="text-gray-500">with Tailwind CSS</p>
        </div>
      </div>
    );
  }
}
